import { useParams } from 'react-router-dom'; // Assuming you are using React Router

const MovieDetail = () => {
    let { id } = useParams(); // This extracts the id parameter from the URL

    return (
        <div>
            MovieDetail for ID: {id}
        </div>
    );
}

export default MovieDetail;
